import React from 'react';
import {Row, Col, Collapse, Typography} from 'antd';
import styled from 'styled-components';
const { Panel } = Collapse;
const PanelStyle = styled(Panel)`
 &&&{
    .ant-collapse-header{
        color: white;
    }
 }
`;

function RoomList(props) {
    return (
        <Collapse ghost defaultActiveKey={['1']}>
            <PanelStyle header="Danh sách các phòng" key="1">
                <Typography.Link >Room 1</Typography.Link>
                <Typography.Link >Room 2</Typography.Link>
                <Typography.Link >Room 3</Typography.Link>
            </PanelStyle>
        </Collapse>
    );
}

export default RoomList;
